import "./App.css";
import bgImage from "./bgImage.png"
import logo from "./logo.png"
function App() {
  return <>
        <div className="pageWrapper" style={{backgroundImage: `url(${bgImage})`}}>
          <div className="logoWrapper">
            <img src={logo} alt="image not found" />
            </div>
            <div className="mainContent">
              Kuch Bhi
            </div>
        </div>
    </>;
}

export default App;
